/**
 * 二叉查找树
 * 二叉查找树要求，在树中的任意一个节点，其左子树中的每个节点的值，都要小于这个节点的值，而右子树节点的值都大于这个节点的值。
 */
public class BinarySearchTree {
    private Node root;
    /**
     * 二叉查找树
     *
     * @param value
     * @return
     */
    public Node find(int value) {
        if (Objects.isNull(root)) {
            return null;
        }
        Node p = root;
        while (Objects.nonNull(p)) {
            if (value == p.data) {
                return p;
            } else if (value > p.data) {
                p = p.right;
            } else {
                p = p.left;
            }
        }
        return null;
    }
    /**
     * @param value
     */
    public void insert(int value) {
        if (Objects.isNull(root)) {
            root = new Node(value);
        } else {
            Node p = root;
            while (Objects.nonNull(p)) {
                if (value  p.data) {
                p = p.right;
            } else {
                p = p.left;
            }
        }
        // 没有找到value的节点
        if (Objects.isNull(p)) {
            return;
        }
        // 被删除的节点有两个子节点，那么查找右树的最小子节点，转移到要删除的节点
        if (Objects.nonNull(p.left) && Objects.nonNull(p.right)) {
            Node minPP = p;
            Node minP = p.right;
            while (Objects.nonNull(minP.left)) {
                minPP = minP;
                minP = minP.left;
            }
            // 右树中值最小的节点的替换要删除节点的值
            p.data = minP.data;
            // 删除节点
            p = minP;
            pp = minPP;
        }
        // 被删除的节点只有一个子节点
        Node child;
        if (Objects.nonNull(p.left)) {
            child = p.left;
        } else if (Objects.nonNull(p.right)) {
            child = p.right;
        } else {
            child = null;
        }

        if (Objects.isNull(pp)) {
            root = child;
        } else if (pp.left == p) {
            pp.left = child;
        } else {
            pp.right = child;
        }
    }
    public int findMax() {
        if (Objects.isNull(root)) {
            return -1;
        } else {
            Node p = root;
            while (Objects.nonNull(p.right)) {
                p = p.right;
            }
            return p.data;
        }
    }
    public int findMin() {
        if (Objects.isNull(root)) {
            return -1;
        } else {
            Node p = root;
            while (Objects.isNull(p.left)) {
                p = p.left;
            }
            return p.data;
        }
    }
}

