线程封闭之ThreadLocal和栈封闭
线程封闭
就是将不需要在线程间共享的数据封闭在线程中,从而杜绝线程安全问题.
ThreadLocal可以理解为JVM维护了一个Map,每个线程要用这个T的时候,用当前线程去Map里取.
栈封闭

局部变量的固有属性之一就是封闭在线程中
他们位于执行线程的栈中,其他线程无法访问这个栈

CODE
/**
 * @ClassName:Demo7
 * @Description: 线程封闭
 * @Date: 2019/1/5 14:06
 * @Author lupo.f@outlook.com
 * @Version 1.0.0
 * @Since JDK 1.8
 */
public class Demo7 {
    /**
     * threadLocal变量，每个线程都有一个副本，互不干扰
     */
    public static ThreadLocal value = new ThreadLocal<>();
    /**
     * threadlocal测试
     *
     * @throws Exception
     */
    public void threadLocalTest() throws Exception {
        // threadlocal线程封闭示例
        value.set("这是主线程设置的123"); // 主线程设置值
        String v = value.get();
        System.out.println("线程1执行之前，主线程取到的值：" + v);
        new Thread(new Runnable() {
            @Override
            public void run() {
                String v = value.get();
                System.out.println("线程1取到的值：" + v);
                // 设置 threadLocal
                value.set("这是线程1设置的456");

                v = value.get();
                System.out.println("重新设置之后，线程1取到的值：" + v);
                System.out.println("线程1执行结束");
            }
        }).start();
        Thread.sleep(5000L); // 等待所有线程执行结束
        v = value.get();
        System.out.println("线程1执行之后，主线程取到的值：" + v);
    }
    public static void main(String[] args) throws Exception {
        new Demo7().threadLocalTest();
    }
}


